import { buscarProdutosPorNome } from '../API/CadProduto';
import './cabecalho.scss';

export default function Cabecalho(props){

    const [produtos, setProdutos] = useState([]);

    const [busca, setBusca] = useState('');

    async function buscarNomeClick() {
        const resp = await buscarProdutosPorNome(busca);
        console.log(resp)
        setProdutos(resp);
    }
    return(
            <header className="cab">
                <img className="logo" src={props.logo}/>
                <img  className='menuCab' src={props.menu}/>
                <div>
                <input className='busca' placeholder='' type={props.type} onChange={props.onChange} ></input>
                <button><img className='icons' src={props.lupa}></img></button>

                </div>
                <img className='icons' src={props.fav}></img>
                <img className='icons' src={props.user}></img>
                <img className='icons' src={props.sacola}></img>
            </header>
        )
}
